INSERT INTO `rekap_akademik` (`id`, `nis`, `nama`, `kelas`, `jenjang`, `cp`, `narasi`, `periode_keterangan`, `tahunajaran`, `murid_id`, `kelas_id`, `periode_id`, `created_at`, `updated_at`) VALUES
(1, 'TK001696', 'ABYAZ DAMAR RAYYANKA', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan, mengukur menggunakan alat ukur tidak baku serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orangtua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 50, 1, 1, '2022-10-07 08:05:08', '2022-10-12 07:18:32'),
(2, 'TK001632', 'ABRAR DAYYAN HAYDAR ALHANAN', 'B2', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah  Ananda sudah dapat menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), dan melakukan proses kerja sesuai dengan prosedurnya.||Alhamdulillah Ananda sudah dapat lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, mampu memahami kontak mata dan bahasa tubuh yang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), dan melompat satu kaki tanpa berpegangan minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal dan melafalkan asmaul husna, berinfaq, bersedekah, berdoa hanya meminta kepada Allah, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berdoa hanya meminta kepada Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, memiliki perasaan merasa diawasi oleh Allah, mengenal bacaan sholat dengan benar, duduk di hadapan orangtua dengan santun, menghafal lafal kalimat thoyibah, berkata jujur dalam keseharian, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, melakukan perbuatan baik setiap hari, mengenal dan mampu mengikuti gerakan Sholat, berwudlu sesuai Rasulullah (pendampingan), mendoakan orangtua, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, menirukan lafal syahadat dan artinya, dan mengetahui dan memahami dari hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah).', 'Tengah', '2022/2023', 131, 5, 1, '2022-10-10 08:03:27', '2022-10-12 07:25:33'),
(6, 'TK001625', 'AL BARR MUHAMMAD RAFASYA', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), menirukan lafal syahadat dan artinya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orangtua, menghafal  syahadat beserta artinya, mengenal ibadah haji, memakai baju sendiri tanpa bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, memiliki perasaan merasa diawasi oleh Allah, menghafal lafal kalimat thoyibah, menirukan sholawat, dan membuang sampah pada tempatnya.', 'Tengah', '2022/2023', 153, 6, 1, '2022-10-11 06:11:03', '2022-10-12 09:06:15'),
(7, 'TK001606', 'ACHMAD SAKHA ALFATIH', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menulis dan membaca kalimat, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, mampu memahami  kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, berdiri satu kaki minimal 11 detik, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, serta ananda mampu menggambar orang (minimal 6 anggota tubuh).||Alhamdulillah Ananda sudah mampu mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mengenal dan melafalkan asmaul husna, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, meminta izin jika mau melakukan sesuatu, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, memiliki perasaan merasa diawasi oleh Allah, menghafal lafal kalimat thoyibah, melakukan perbuatan baik setiap hari, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan Sholat, mengenal bacaan sholat dengan benar, berinfaq, bersedekah , mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, memakai baju sendiri tanpa bantuan, serta mampu mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras).', 'Tengah', '2022/2023', 108, 2, 1, '2022-10-11 06:31:05', '2022-10-12 07:51:39'),
