(9, 'TK001683', 'ADHYASTHA KHAYRU PRATAMA', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat  melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasikan benda berdasarkan ciri - ciri tertentu ( warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak-sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku,  dan mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, lingkaran, dan Menjiplak bentuk.||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya , mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentu orang lain), mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangttua dengan sebutan yang baik (misal bapak, ibu, mama, papa dll), duduk di hadapan orangtua dengan santun, segera menjawab seruan orangtua apabila dipanggil, dan mau mendengarkan ketika orangtua berbicara.', 'Tengah', '2022/2023', 79, 4, 1, '2022-10-11 06:35:02', '2022-10-12 07:14:39'),
