(14, 'TK001722', 'ALARIC  RASYID ARDIANTO', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah cakap dalam  mengurus diri dan perbekalan pribadi, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat beserta artinya, mengenal ibadah haji, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, memiliki perasaan merasa diawasi oleh Allah, berjalan dengan tenang dan fokus, menghafal lafal kalimat thoyibah, menirukan sholawat, dan berkata jujur dalam keseharian.', 'Tengah', '2022/2023', 154, 6, 1, '2022-10-11 07:20:07', '2022-10-12 08:25:46'),
(15, 'TK001647', 'ALTA THANISA SANSU', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat membuang sampah pada tempatnya, berwudlu sesuai Rasulullah (pendampingan), berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, mengenal ibadah haji, mengucapkan salam, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, dan menirukan sholawat.', 'Tengah', '2022/2023', 155, 6, 1, '2022-10-11 07:27:00', '2022-10-12 07:01:16'),
(16, 'TK001747', 'JAZAQILLAH ALANA MAWARDI', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda dapat melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasikan benda berdasarkan ciri - ciri tertentu ( warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak-sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku,  dan mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat mengekspresikan emosi yang sesuai dengan kondisi yang ada,  cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, lingkaran, dan Menjiplak bentuk.||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentu orang lain), mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal bapak, ibu, mama, papa dll), duduk di hadapan orangtua dengan santun, segera menjawab seruan orangtua apabila dipanggil, dan mau mendengarkan ketika orangtua berbicara.', 'Tengah', '2022/2023', 107, 4, 1, '2022-10-11 07:44:59', '2022-10-12 07:56:21'),
