(30, 'TK001667', 'ADZKIYA FARADIBA MAHESWARI', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.||Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjiplak bentuk, melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan , menceritakan kembali cerita yang didengar, cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, mengklasifikasikan benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, dan melompat ke depan dan ke belakang.||Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Mendoakan orangtua.,Menirukan lafal syahadat dan artinya ,Mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.,Duduk di hadapan orangtua dengan santun.,Mau mendengarkan ketika orangtua berbicara.,Mengekspresikan emosi yang sesuai dengan kondisi yang ada.,Mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentu orang lain).', 'Tengah', '2022/2023', 80, 4, 1, '2022-10-11 07:48:02', '2022-10-11 07:48:02'),
