(33, 'TK001667', 'ADZKIYA FARADIBA MAHESWARI', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.||Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.,Menjiplak bentuk.,Melaksanakan perintah sederhana sesuai aturan yang disampaikan.,Melaksanakan perintah sederhana sesuai aturan yang disampaikan.,Memahami kalimat ajakan ,Membaca kartu fonem lembar apel dan bola,Cakap dalam  mengurus diri dan perbekalan pribadi,Memegang kartu fonem.,Mampu beradaptasi dengan lingkungan baru,Mengklasifikasikan benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi).,Merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya,Mengenal konsep besar-kecil, banyak-sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan.,Berjalan mundur.,Melompat ke depan dan ke belakang.||Alhamdulillah, ADZKIYA FARADIBA MAHESWARI sudah dapat Mendoakan orangtua, menirukan lafal syahadat dan artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, duduk di hadapan orangtua dengan santun, mau mendengarkan ketika orangtua berbicara, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentu orang lain), dan segera menjawab seruan orang tua apabila dipanggil.', 'Tengah', '2022/2023', 80, 4, 1, '2022-10-11 07:48:27', '2022-10-11 07:48:27'),
(34, 'TK001626', 'ANDI AZZAM HAMZAH DJOEDDAWI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat mengucapkan kalimat thoyyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orang tua, mengenal ibadah haji, mengucapkan salam, memakai baju sendiri tanpa bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, membantu pekerjaan orang tua, dan menirukan sholawat.', 'Tengah', '2022/2023', 156, 6, 1, '2022-10-11 07:56:43', '2022-10-12 08:26:29'),
(35, 'PG000981', 'ALTHAFANDRA GAVIN ABQARY', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), membaca kartu fonem lembar apel, memegang kartu fonem, menyanyikan lagu fonik huruf vokal, mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan (masih diingatkan).||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, meminta izin jika mau melakukan sesuatu, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 1, 8, 1, '2022-10-11 07:58:28', '2022-10-12 08:20:28'),
(36, 'TK001698', 'ARKANA RAYYAN SAFARAZ', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 53, 1, 1, '2022-10-11 08:08:35', '2022-10-12 08:31:17'),
(37, 'TK001733', 'ARSENIO SHAQUILLE AR RAFIF', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 54, 1, 1, '2022-10-11 08:11:44', '2022-10-12 08:32:03'),
