(44, 'TK001717', 'GALANG AZKA NARENDRA', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan,  mengucapkan salam, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat serta mau mendengarkan ketika orangtua berbicara.', 'Tengah', '2022/2023', 60, 1, 1, '2022-10-11 08:33:02', '2022-10-12 07:57:03'),
(45, 'TK001652', 'ARAZKA RADEYA ZHAAFIR', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, menggambar orang (minimal 6 anggota tubuh), menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu memahami  kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan salam, memakai baju sendiri tanpa bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, meminta izin jika mau melakukan sesuatu, memiliki perasaan merasa diawasi oleh Allah, menghafal lafal kalimat thoyibah, menirukan sholawat, dan berkata jujur dalam keseharian.', 'Tengah', '2022/2023', 157, 6, 1, '2022-10-11 08:45:54', '2022-10-12 08:26:56'),
(46, 'TK001576', 'ATHALLAH FAUSTINE ADIYANT', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, dan emahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll), mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, mengucapkan salam, mengenal alam semesta dan isinya sebagai ciptaan Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, dan menghafal lafal kalimat thoyibah.', 'Tengah', '2022/2023', 158, 6, 1, '2022-10-11 08:49:56', '2022-10-12 08:27:16'),
(47, 'TK001630', 'HANIFA NAFIA ALMEERRA', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), memahami dan merespon secara tepat informasi dan instruksi yang ada, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, melakukan proses kerja sesuai dengan prosedurnya, menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, cakap dalam  mengurus diri dan perbekalan pribadi, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, mampu datang ke sekolah tepat waktu, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), menirukan sholawat, mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui, memahami, memaknai, dan mengambil pelajaran dari hari besar agama islam (Hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, maulid Nabi, tahun baru hijriyah), mengucapkan salam, mengenal dan melafalkan asmaul husna, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdo\'a hanya meminta kepada Allah, memiliki perasaan merasa diawasi oleh Allah, duduk di hadapan orang tua dengan santun, menghafal lafal kalimat thoyibah, menirukan sholawat, dan berkata jujur dalam keseharian.', 'Tengah', '2022/2023', 159, 6, 1, '2022-10-11 08:57:49', '2022-10-12 08:28:03'),
