(49, 'TK001599', 'KIRANA ANINDYA TUNGGA DEWI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20., menulis dan membaca kalimat, serta memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, mampu datang ke sekolah tepat waktu, melakukan berbagai gerakan terkoordinasi seraca terkontrol, seimbang, dan lincah, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat membuang sampah pada tempatnya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, hafal dan mengimplementasikan do\'a-do\'a harian, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdo\'a hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, menunjukka adab kepada guru, dan menirukan sholawat.', 'Tengah', '2022/2023', 161, 6, 1, '2022-10-11 09:08:08', '2022-10-12 08:30:13'),
(50, 'TK001631', 'MISHA AQILLA SHAZFA KRESNADI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu datang ke sekolah tepat waktu, melakukan permainan fisik dengan aturan, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, mengucapkan salam, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, mempunyai inisiatif membantu teman yang membutuhkan bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, menghafal lafal kalimat thoyibah, dan menirukan sholawat.', 'Tengah', '2022/2023', 162, 6, 1, '2022-10-11 09:15:18', '2022-10-12 08:31:11'),
(51, 'TK001601', 'MUHAMMAD AFDHALUSH SHOLAH HERMAWAN', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), empar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, mampu datang ke sekolah tepat waktu, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat membuang sampah pada tempatnya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mau mendengarkan ketika orang tua berbicara, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, menunjukka adab kepada guru, menghafal lafal kalimat thoyibah, dan menirukan sholawat.', 'Teng