(52, 'TK001596', 'M. ARKAN AL FATIH', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menulis dan membaca kalimat, dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu datang ke sekolah tepat waktu, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat membuang sampah pada tempatnya, menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), menirukan sholawat, mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui, memahami, memaknai, dan mengambil pelajaran dari hari besar agama islam (Hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, maulid Nabi, tahun baru hijriyah), mengucapkan salam, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, menutup hidung dan mulut ketika batuk dan bersin, memohon maaf bila bersalah, mempunyai inisiatif membantu teman yang membutuhkan bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mau mendengarkan ketika orang tua berbicara, berjalan dengan tenang dan fokus, mendoakan orang tua, berdoa hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, memiliki perasaan merasa diawasi oleh Allah, menunjukka adab kepada guru, membantu pekerjaan orang tua, duduk di hadapan orang tua dengan santun, menghafal lafal kalimat thoyibah, dan menirukan sholawat.', 'Tengah', '2022/2023', 164, 6, 1, '2022-10-11 09:30:15', '2022-10-12 08:36:14'),
(53, 'TK001654', 'NAFEESHA ALMAHYRA PRAMANA PUTRI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), memahami dan merespon secara tepat informasi dan instruksi yang ada, menggabungkan bunyi suku kata tertutup, menulis dan membaca kalimat., dan memahami kalimat ajakan.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat membuang sampah pada tempatnya, menirukan lafal syahadat dan artinya, berwudlu sesuai Rasulullah (pendampingan), menirukan sholawat, mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengucapkan salam, mengenal dan melafalkan asmaul husna, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, berjalan dengan tenang dan fokus, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, membantu pekerjaan orang tua, menghafal lafal kalimat thoyibah, dan menirukan sholawat.', 'Tengah', '2022/2023', 165, 6, 1, '2022-10-11 09:35:40', '2022-10-12 08:36:54');
