(55, 'TK001597', 'NIRVANA KARA RAIZANDHA', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menggabungkan bunyi suku kata tertutup, dan menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, menulis nama sendiri, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, mengucapkan salam, mengenal dan melafalkan asmaul husna, mengenal alam semesta dan isinya sebagai ciptaan Allah, berdo\'a hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, menghafal lafal kalimat thoyibah, dan menirukan sholawat.', 'Tengah', '2022/2023', 167, 6, 1, '2022-10-11 09:47:24', '2022-10-12 08:41:00'),
(56, 'TK001617', 'NISA SHAKILA RAMADHANI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya dan mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu datang ke sekolah tepat waktu, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan sholawat, membuang sampah pada tempatnya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya,  berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan do\'a-do\'a harian, mengucapkan salam, memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, mendoakan orang tua, berdo\'a hanya meminta kepada Allah, dan meminta izin jika mau melakukan sesuatu dan menghafal lafal kalimat thoyibah.', 'Tengah', '2022/2023', 168, 6, 1, '2022-10-11 09:53:30', '2022-10-12 08:41:35'),
(57, 'TK001688', 'AHMAD ALKHALIFI ZIKRI AL HAFIDZ', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat sudah dapat  melaksanakan perintah sederhana sesuai aturan yang disampaikan,  mengklasifikasikan benda berdasarkan ciri - ciri tertentu ( warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), \r\n dan mengenal konsep besar-kecil, banyak-sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan.||Alhamdulillah Ananda sudah  cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, dan Menjiplak bentuk.||Alhamdulillah Ananda  sudah dapat mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orant tua dengan sebutan yang baik (misal bapak, ibu, mama, papa dll), duduk di hadapan orangtua dengan santun, segera menjawab seruan orangtua apabila dipanggil, dan mau mendengarkan ketika orangtua berbicara.', 'Tengah', '2022/2023', 81, 4, 1, '2022-10-11 10:32:09', '2022-10-12 07:16:52'),
(58, 'TK001661', 'AISYAH RANIAH AZZAHRA', 'A3', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulilla Ananda sudah dapat melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku,  membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasikan benda berdasarkan ciri - ciri tertentu ( warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak-sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku,  dan mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah  cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, lingkaran, dan Menjiplak bentuk.||Alhamdulillah Ananda sudah dapat menirukan lafal syahadat dan artinya, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentu orang lain), mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal bapak, ibu, mama, papa dll), duduk di hadapan orangtua dengan santun, segera menjawab seruan orangtua apabila dipanggil, dan mau mendengarkan ketika orangtua berbicara.', 'Tengah', '2022/2023', 82, 4, 1, '2022-10-11 10:38:57', '2022-10-12 07:17:46'),
