(70, 'TK001715', 'HANUM NABILA JATMIKO', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi) serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam,   mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 62, 1, 1, '2022-10-11 13:02:19', '2022-10-12 08:01:24'),
(71, 'TK001709', 'AQLAN NAZEL DAYYAN AL KAYSAN', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), serta mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan.||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 52, 1, 1, '2022-10-11 13:07:45', '2022-10-12 08:30:42'),
(72, 'TK001695', 'ALMEERA HANIN AFFATHANISSA', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan serta mengukur menggunakan alat ukur tidak baku.||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 51, 1, 1, '2022-10-11 13:10:17', '2022-10-12 08:30:05'),
(73, 'TK001728', 'AINAYYA ASMA PRATOMO', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menulis dan membaca kalimat, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berdiri satu kaki minimal 11 detik, serta mampu menggambar orang (minimal 6 anggota tubuh).||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, \r\n mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mengenal dan melafalkan asmaul husna, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta.,Berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian,memiliki perasaan merasa diawasi oleh Alla , menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, mengenal dan mampu mengikuti gerakan sholat, berinfaq, bersedekah, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 113, 2, 1, '2022-10-11 13:10:25', '2022-10-12 07:55:43'),
(74, 'TK001622', 'AQILAH AZZALEA HULWAH', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20m, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berdiri satu kaki minimal 11 detik., melompat satu kaki tanpa berpegangan sejauh minimal 1 m, serta mampu menggambar orang (minimal 6 anggota tubuh).||Alhamdulillah Ananda sudah dapat mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mengenal dan melafalkan asmaul husna  meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, meminta izin jika mau melakukan sesuatu berdoa hanya meminta kepada Allah berkata jujur dalam keseharian, memiliki perasaan merasa diawasi oleh Allah, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, mengenal dan mampu mengikuti gerakan Sholat, mengenal bacaan sholat dengan benar,berinfaq, bersedekah,mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 114, 2, 1, '2022-10-11 13:16:21', '2022-10-12 07:56:21'),
