(82, 'TK001656', 'ARSYA REINDRA ZEN', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menulis nama sendiri, mampu memahami  kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, serta mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta,  berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, meminta izin jika mau melakukan sesuatu, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, memiliki perasaan merasa diawasi oleh Allah, melakukan perbuatan baik setiap hari, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, mengenal dan mampu mengikuti gerakan Sholat, berinfaq, bersedekah, men