duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 69, 1, 1, '2022-10-11 13:47:42', '2022-10-12 08:14:32'),
(85, 'TK001624', 'AZKIYA NURIN NISA\'', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menulis dan membaca kalimat, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta ananda mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan),Berdiri satu kaki minimal 11 detik, serta mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husna ,mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.,Meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan Sholat, mengenal bacaan sholat dengan benar, berinfaq, bersedekah ,serta ananda mampu mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian. serta ananda juga mampu memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 117, 2, 1, '2022-10-11 13:49:15', '2022-10-12 07:59:16'),
