(93, 'TK001742', 'AIRIN AZKA MUMTAZA', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan  membandingkan, mengukur menggunakan alat ukur tidak baku, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 76, 1, 1, '2022-10-11 14:07:52', '2022-10-12 08:27:05'),
(94, 'TK001744', 'TAQIYA ALESHA MAHIRA', 'A2', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan,  membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, serta melompat ke depan dan ke belakang.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, ,mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain),  mendoakan orangtua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orangtua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orangtua ketika tidur atau istirahat, segera menjawab seruan orangtua apabila dipanggil, mau mendengarkan ketika orangtua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 77, 1, 1, '2022-10-11 14:11:18', '2022-10-12 08:28:44'),
(95, 'TK001633', 'DEVAN DANADYAKSA MULYANI', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20m, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta ananda mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah mampu memahami  kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, serta menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan sholat, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 119, 2, 1, '2022-10-11 14:13:00', '2022-10-12 07:15:41'),
(96, 'TK001637', 'EVANDER ALKHALIFI ARSYANTO', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan,memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), mampu memahami   kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), berdiri satu kaki minimal 11 detik, serta mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husn \r\n mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, meminta izin jika mau melakukan sesuatu, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan Sholat, berinfaq, bersedekah , mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta ananda mampu memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 120, 2, 1, '2022-10-11 14:23:22', '2022-10-12 07:17:01'),
