023', 120, 2, 1, '2022-10-11 14:23:22', '2022-10-11 14:23:22'),
(98, 'TK001543', 'HASNA ALTHAFUNNISA BACHTIAR', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berdiri satu kaki minimal 11 detik, serta mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda Hasna Althafunnisa Bachtiar sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husna, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan sholat, berinfaq, bersedekah, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 121, 2, 1, '2022-10-11 14:31:04', '2022-10-12 07:18:34'),
