(100, 'TK001609', 'KHAIRUNNISA AZZAHRA DYANDRA H', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), serta  mampu merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdoa hanya meminta kepada Allah ,berkata jujur dalam keseharian, melakukan perbuatan baik setiap hari, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, mengenal dan mampu mengikuti gerakan sholat, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 123, 2, 1, '2022-10-11 14:49:18', '2022-10-12 07:27:31'),
(101, 'TK001619', 'MAUDY SHINTA RAMADHANI', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20 ,menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta ananda juga mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), mampu memahami   kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, serta mampu menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan (masih diingatkan).||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras).,Mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husna , mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri,meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan sholat, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 124, 2, 1, '2022-10-11 14:54:57', '2022-10-12 07:29:09'),
(102, 'TK001608', 'M. AGAM AL BARRA', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menulis dan membaca kalimat, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta ananda mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, mampu memahami   kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, berdiri satu kaki minimal 11 detik, serta mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husna , mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, m mnghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya. , mengenal dan mampu mengikuti gerakan Sholat, mengenal bacaan sholat dengan benar, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian, dan memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 125, 2, 1, '2022-10-11 15:01:47', '2022-10-12 07:30:41');
INSERT INTO `rekap_akademik` (`id`, `nis`, `nama`, `kelas`, `jenjang`, `cp`, `narasi`, `periode_keterangan`, `tahunajaran`, `murid_id`, `kelas_id`, `periode_id`, `created_at`, `updated_at`) VALUES
(103, 'TK001618', 'SYIFA NUR AINI', 'B2', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menyusun kalimat sederhana dalam struktur lengkap (subjek-predikat-keterangan), menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta melakukan proses kerja sesuai dengan prosedurnya.||Alhamdulillah Ananda sudah dapat lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), dan melompat satu kaki tanpa berpegangan minimal 1 m serta mampu memahami   kontak mata dan bahasa tubuh yang lain.||Alhamdulillah Ananda sudah dapat mengetahui dan memahami dari hari besar agamaIslam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah), mengenal dan melafalkan asmaul husna, berinfaq, bersedekah, berdoa hanya meminta kepada Allah, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berdoa hanya meminta kepada Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, memiliki perasaan merasa diawasi oleh Allah, mengenal bacaan sholat dengan benar, duduk di hadapan orangtua dengan santun, menghafal lafal kalimat thoyibah, berkata jujur dalam keseharian, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, melakukan perbuatan baik setiap hari, mengenal dan mampu mengikuti gerakan Sholat, berwudlu sesuai Rasulullah (pendampingan), mendoakan orangtua, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta menghafal syahadat beserta artinya.', 'Tengah', '2022/2023', 133, 5, 1, '2022-10-11 15:03:39', '2022-10-12 07:28:18'),
(104, 'TK001645', 'M. ALIYANDI HAZZA', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, memahami kalimat ajakan, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, serta mampu menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah mampu menghafal syahadat berserta artinya, mengucapkan dan menjawab salam, \r\n mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, menghafal lafal kalimat thoyibah, mengenal dan mampu mengikuti gerakan sholat, mengenal ibadah haji, serta mampu menghafal dan mengimplementasikan  do\'a-do\'a harian.', 'Tengah', '2022/2023', 126, 2, 1, '2022-10-11 15:09:17', '2022-10-12 07:31:49'),
(105, 'TK001623', 'M. ARKHA ARYASTIA', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan,  memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali. Ananda mampu menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur) serta mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah dapat menggambar orang (minimal 6 anggota tubuh), mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, berdiri satu kaki minimal 11 detik, serta ananda mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah mampu mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal  syahadat berserta artinya, mengenal dan melafalkan asmaul husna,  mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, meminta izin jika mau melakukan sesuatu, berdoa hanya meminta kepada Allah, berkata jujur dalam keseharian, melakukan perbuatan baik setiap hari, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, mengenal dan mampu mengikuti gerakan sholat, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta mampu memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 127, 2, 1, '2022-10-11 15:16:10', '2022-10-12 07:33:46'),
