 memiliki perasaan merasa diawasi oleh Allah, berkata jujur dalam keseharian, melakukan perbuatan baik setiap hari, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan Sholat, mengenal bacaan sholat dengan benar, berinfaq, bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta mampu memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 129, 2, 1, '2022-10-11 15:30:17', '2022-10-12 07:38:00'),
(109, 'TK001748', 'ANINDYA RAIMA DANASWORO', 'B1', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat melaksanakan perintah yang lebih kompleks sesuai aturan yang disampaikan, menceritakan kembali apa yang didengar dengan kosakata yang lebih, memahami kalimat ajakan, memahami isi cerita, membuat karya yang menunjukkan ide, gagasan, atau perasaannya, menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menulis dan membaca kalimat, menyebutkan lambang bilangan 1-20, menggunakan lambang bilangan untuk menghitung (hasil maksimal 10), mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta  mampu membuat karya seni sesuai kreativitasnya.||Alhamdulillah Ananda sudah mampu menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri., mampu memahami kontak mata dan bahasa tubuh yang lain, mampu berteman dan bekerjasama dengan orang lain, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berdiri satu kaki minimal 11 detik, serta juga mampu melompat satu kaki tanpa berpegangan sejauh minimal 1 m.||Alhamdulillah Ananda sudah dapat mengenal kebiasaan buruk bagi kesehatan (minuman dan makanan yang tidak sehat, rokok, minuman keras), mendoakan orangtua, menghafal syahadat berserta artinya, mengenal dan melafalkan asmaul husna,   mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, meminta izin jika mau melakukan sesuatu, berdoa hanya meminta kepada Allah, memiliki perasaan merasa diawasi oleh Allah, berkata jujur dalam keseharian, melakukan perbuatan baik setiap hari, menghafal lafal kalimat thoyibah, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan Sholat, berinfaq, bersedekah,  mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta ananda juga mampu memakai baju sendiri tanpa bantuan.', 'Tengah', '2022/2023', 130, 2, 1, '2022-10-11 15:37:39', '2022-10-12 07:39:21'),
(110, 'TK001639', 'AULIYA ADILA BILQIS', 'B2', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta melakukan proses kerja sesuai dengan prosedurnya.||Alhamdulillah Ananda sudah dapat lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), melompat satu kaki tanpa berpegangan minimal 1 m, serta mampu memahami   kontak mata dan bahasa tubuh yang lain.||Alhamdulillah Ananda sudah dapat mengetahui dan memahami dari hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah), mengenal dan melafalkan asmaul husna  Berinfaq, bersedekah  berdoa hanya meminta kepada Allah, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berdoa hanya meminta kepada Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, memiliki perasaan merasa diawasi oleh Allah, mengenal bacaan sholat dengan benar  duduk di hadapan orang tua dengan santun, menghafal lafal kalimat thoyibah berkata jujur dalam keseharian, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya,  melakukan perbuatan baik setiap hari, mengenal dan mampu mengikuti gerakan Sholat, berwudlu sesuai Rasulullah (pendampingan) mendoakan orang tua, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta menghafal syahadat beser