(122, 'TK001513', 'NISMARA FARZANA AISHA RATIFA', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), memahami dan merespon secara tepat informasi dan instruksi yang ada, dan menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri. menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan sholawat, menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orang tua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan do\'a-do\'a harian, mengenal dan melafalkan asmaul husna, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdo\'a hanya meminta kepada Allah, memiliki perasaan merasa diawasi oleh Allah, duduk di hadapan orang tua dengan santun, berkata jujur dalam keseharian, dan menghafal lafal kalimat thoyibah.', 'Tengah', '2022/2023', 169, 6, 1, '2022-10-12 06:18:42', '2022-10-12 08:42:04'),
