(126, 'TK001724', 'RADYANA ALESHA PRAMESTI', 'B2', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menyusun kalimat sederhana dalam struktur lengkap (subjek-predikat-keterangan) menunjukkan perilaku senang membaca buku terhadap buku-buku yang dikenali, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta melakukan proses kerja sesuai dengan prosedurnya.||Alhamdulillah Ananda sudah dapat lempar tangkap bola kecil sebesar bola tenis dengan menggunakan kedua tangan, menggambar orang (minimal 6 anggota tubuh), menulis nama sendiri, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), melompat satu kaki tanpa berpegangan minimal 1 m, serta mampu memahami kontak mata dan bahasa tubuh yang lain.||Alhamdulillah Ananda sudah dapat mengetahui dan memahami dari hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah), mengenal dan melafalkan asmaul husna, berinfaq, bersedekah  berdoa hanya meminta kepada Allah, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berdoa hanya meminta kepada Allah, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, memiliki perasaan merasa diawasi oleh Allah, mengenal bacaan sholat dengan benar  duduk di hadapan orang tua dengan santun, menghafal lafal kalimat thoyibah berkata jujur dalam keseharian, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya,  melakukan perbuatan baik setiap hari, mengenal dan mampu mengikuti gerakan Sholat, berwudlu sesuai Rasulullah (pendampingan) mendoakan orang tua, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, serta menghafal syahadat beserta artinya.', 'Tengah', '2022/2023', 149, 5, 1, '2022-10-12 06:28:09', '2022-10-12 08:00:31'),
