afal dan mengimplementasikan  do\'a-do\'a harian, serta menghafal syahadat beserta artinya.', 'Tengah', '2022/2023', 151, 5, 1, '2022-10-12 06:31:42', '2022-10-12 08:02:27'),
(129, 'PG000982', 'ARFAN MUHAMMAD AL RAIS', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), membaca kartu fonem lembar apel, memegang kartu fonem, menyanyikan lagu fonik huruf vokal, mengenal serta mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah,  mentaati aturan yang berlaku, mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), seta mampu mengelola emosi sesuai perkembangan.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memohon maaf bila bersalah, meminta izin jika mau melakukan sesuatu, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah,  makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 2, 8, 1, '2022-10-12 08:28:41', '2022-10-12 08:28:41'),
(130, 'PG000984', 'AZIRAH NASYWA ALIS', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), membaca kartu fonem lembar apel, memegang kartu fonem, menyanyikan lagu fonik huruf vokal, serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), serta mampu mengelola emosi sesuai perkembangan.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 3, 8, 1, '2022-10-12 08:38:13', '2022-10-12 08:38:13'),
(131, 'TK001704', 'ADREENA KANYA MARDHIKA', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orang tua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 21, 3, 1, '2022-10-12 08:46:36', '2022-10-12 21:12:29'),
(132, 'TK001644', 'RAFFASYA ARKAAN ALHAQQI', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat Melompat satu kaki tanpa berpegangan sejauh minimal 1 m. Menggambar orang (minimal 6 anggota tubuh). Mampu datang ke sekolah tepat waktu Melompat satu kaki tanpa berpegangan sejauh minimal 1 m. mampu berteman dan bekerjasama dengan orang lain mampu berteman dan bekerjasama dengan orang lain Mampu beradaptasi dengan lingkungan baru melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan)  Berdiri satu kaki minimal 11 detik. Melakukan permainan fisik dengan aturan. Menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menghafal lafal kalimat thoyibah, menirukan sholawat, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orangtua, menghafal  syahadat berserta artinya, mengenal ibadah haji, mengetahui, memahami, memaknai, dan mengambil pelajaran dari hari besar agama islam (Hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, maulid Nabi, tahun baru hijriyah), mengenal dan melafalkan asmaul husna, mengenal alam semesta dan isinya sebagai ciptaan Allah, mempunyai inisiatif membantu teman yang membutuhkan bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendo\'akan orangtua, berdo\'a hanya meminta kepada Allah, dan senang menolong orang lain.', 'Tengah', '2022/2023', 171, 6, 1, '2022-10-12 08:49:19', '2022-10-12 08:49:19'),
(133, 'PG000993', 'CARISSA NAMIRA PUTRI', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), membaca kartu fonem lembar apel, memegang kartu fonem, menyanyikan lagu fonik huruf vokal, serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku,  mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), serta mampu mengelola emosi sesuai perkembangan.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 4, 8, 1, '2022-10-12 08:49:24', '2022-10-12 08:49:24'),
(134, 'TK001691', 'SHAKILA INARA MARITZA', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, cakap dalam  mengurus diri dan perbekalan pribadi, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll), mampu datang ke sekolah tepat waktu, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan sholawat, membuang sampah pada tempatnya, menirukan lafal syahadat dan artinya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orangtua, menghafal  syahadat berserta artinya, mengenal ibadah haji, mengucapkan salam memakai baju sendiri tanpa bantuan, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, dan berdo\'a hanya meminta kepada Allah.', 'Tengah', '2022/2023', 172, 6, 1, '2022-10-12 08:54:33', '2022-10-12 08:55:01'),
(135, 'PG000985', 'HAMZAH AL QORNI DANISWARA', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), membaca kartu fonem lembar apel, memegang kartu fonem, menyanyikan lagu fonik huruf vokal,  serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah mampu mengelola emosi sesuai perkembangan, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah,  mentaati aturan yang berlaku, mengekspresikan emosi yang sesuai dengan kondisi yang ada, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memohon maaf bila bersalah, meminta izin jika mau melakukan sesuatu, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 5, 8, 1, '2022-10-12 08:56:40', '2022-10-12 08:56:40'),
(136, 'PG000979', 'JAN CETTA NARENDRA', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu mengelola emosi sesuai perkembangan, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah,  mentaati aturan yang berlaku, serta mengekspresikan emosi yang sesuai dengan kondisi yang ada.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, meminta izin jika mau melakukan sesuatu, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 6, 8, 1, '2022-10-12 09:00:43', '2022-10-12 09:00:43'),
(137, 'TK001627', 'ADREENA MALIEKA KHAIRIY', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), serta menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, menggambar orang (minimal 6 anggota tubuh), menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu memahami kontak mata dan bahasa tubuh yang lain, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menghafal lafal kalimat thoyibah, menirukan sholawat, menirukan lafal syahadat dan artinya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan do\'a-do\'a harian, membantu pekerjaan orangtua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, hafal dan mengimplementasikan do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, berjalan dengan tenang dan fokus, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, berdo\'a hanya meminta kepada Allah, meminta izin jika mau melakukan sesuatu, memiliki perasaan merasa diawasi oleh Allah, dan berkata jujur dalam keseharian.', 'Tengah', '2022/2023', 173, 6, 1, '2022-10-12 09:01:27', '2022-10-12 09:01:27'),
(138, 'PG000995', 'MUHAMMAD FATIH ALHAKIM', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mentaati aturan yang berlaku, serta mengekspresikan emosi yang sesuai dengan kondisi yang ada.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 7, 8, 1, '2022-10-12 09:04:16', '2022-10-12 09:04:16'),
(139, 'TK001739', 'ABDULLAH AZZAM SUBIANTOKO', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orang tua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 47, 3, 1, '2022-10-12 09:04:39', '2022-10-12 09:04:39'),
(140, 'TK001612', 'ZAIDAN AHMAD ALKAF', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat memahami kalimat ajakan, membuat karya seni sesuai kreativitasnya, menyebutkan lambang bilangan 1-20, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), dan menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat melompat satu kaki tanpa berpegangan sejauh minimal 1 m, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, menulis nama sendiri, mampu datang ke sekolah tepat waktu, melompat satu kaki tanpa berpegangan sejauh minimal 1 m, mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan), berdiri satu kaki minimal 11 detik, melakukan permainan fisik dengan aturan, dan menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat menirukan sholawat, membuang sampah pada tempatnya, mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya, berwudlu sesuai Rasulullah (pendampingan), mengenal dan mampu mengikuti gerakan sholat, hafal dan mengimplementasikan  do\'a-do\'a harian, membantu pekerjaan orangtua, menghafal  syahadat berserta artinya, berinfaq dan bersedekah, mengenal ibadah haji, memakai baju sendiri tanpa bantuan, meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta, mendo\'akan orangtua, dan berdo\'a hanya meminta kepada Allah.', 'Tengah', '2022/2023', 174, 6, 1, '2022-10-12 09:05:18', '2022-10-12 09:05:18'),
