(143, 'PG000976', 'MUHAMMAD YAHYA AL-BASSAM', 'PG 1', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur), menjawab pertanyaan tentang identitas diri (nama panggilan), serta mengenal dan mengidentifikasi bunyi huruf vokal.||Alhamdulillah Ananda sudah dapat menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan), mampu mengelola emosi sesuai perkembangan, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mengikuti garis lurus, mencoret kertas tanpa bantuan/petunjuk, mampu berteman dan bekerjasama dengan orang lain, bersabar menunggu giliran, mampu beradaptasi dengan lingkungan baru, mentaati aturan yang berlaku, serta mengekspresikan emosi yang sesuai dengan kondisi yang ada.||Alhamdulillah Ananda sudah dapat meneladani Rasulullah, melakukan perbuatan baik setiap hari, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, menirukan lafal kalimat thoyibah, berinfaq, bersedekah, makan sendiri, membantu pekerjaan orangtua, menggosok gigi, duduk di hadapan orangtua dengan santun, memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, mencuci dan mengeringkan tangan sendiri dengan baik, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri.', 'Tengah', '2022/2023', 10, 8, 1, '2022-10-12 09:16:48', '2022-10-12 09:16:48'),
(144, 'TK001746', 'ABHIPRAYA LUCKMAN EL FAUZIE', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, membuat garis vertikal, horizontal, lengkung kiri/kanan, miring kiri/kanan, dan lingkaran, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 49, 3, 1, '2022-10-12 09:17:17', '2022-10-12 09:17:17'),
