(168, 'TK001662', 'ATHAR ARSYAD UTOMO', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orang tua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 25, 3, 1, '2022-10-12 10:38:08', '2022-10-12 18:52:24'),
(169, 'TK001690', 'ALESHA KANIA ZHAFIRAH KURNIAWAN', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, memegang kartu fonem, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orang tua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 22, 3, 1, '2022-10-12 10:42:06', '2022-10-12 21:14:34'),
(170, 'TK001700', 'MUHAMMAD HANAN ASH-SHIDDIQ', 'A1', 'TK A', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda mampu melaksanakan perintah sederhana sesuai aturan yang disampaikan, memahami kalimat ajakan, menceritakan gambar yang ada dalam buku, membaca kartu fonem lembar apel dan bola, mengklasifikasi benda berdasarkan ciri-ciri tertentu (warna, jenis, ukuran, bentuk, jumlah, suara, tekstur, dan fungsi), mengenal konsep besar-kecil, banyak sedikit, panjang-pendek, berat-ringan, tinggi-rendah, tebal-tipis dengan kegiatan membandingkan, mengukur menggunakan alat ukur tidak baku, mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda mampu mengekspresikan emosi yang sesuai dengan kondisi yang ada, cakap dalam  mengurus diri dan perbekalan pribadi, menjaga dan merawat fasilitas dan kebersihan lingkungan sekolah, mampu beradaptasi dengan lingkungan baru, mampu datang ke sekolah tepat waktu, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, berjalan mundur, melompat ke depan dan ke belakang, serta menjiplak bentuk.||Alhamdulillah Ananda mampu menirukan lafal syahadat dan artinya, mengenal dan melafalkan asmaul husna, berdoa hanya kepada Allah, menghafal lafal kalimat thoyibah, mengenal ibadah haji, hafal dan mengimplementasikan  do\'a-do\'a harian, mengetahui dan memahami hari besar agama Islam (hari raya Idul Fitri, Idul Adha, Isra\' Mi\'raj, Maulid Nabi, tahun baru Hijriyah),  mengucapkan salam, mengenali bagian tubuh yang harus dilindungi (boleh disentuh dan tidak boleh disentuh orang lain), mendoakan orang tua, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, memanggil orang tua dengan sebutan yang baik (misal ibu, bapak, mama, papa dll), duduk di hadapan orangtua dengan santun, tidak mengagetkan orang tua ketika tidur atau istirahat, segera menjawab seruan orang tua apabila dipanggil, mau mendengarkan ketika orang tua berbicara, serta menunjukkan adab kepada saudara.', 'Tengah', '2022/2023', 37, 3, 1, '2022-10-12 18:20:09', '2022-10-12 18:22:37'),
(171, 'PG000989', 'ABRAHAM BANYU NARENDRA', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, mengekspresikan emosi yang sesuai dengan kondisi yang ada, mampu mengelola emosi sesuai perkembangan, bersabar menunggu giliran, serta menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, meneladani Rasulullah, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, membantu pekerjaan orangtua, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, serta menirukan lafal kalimat thoyibah Makan sendiri Menggosok gigi.', 'Tengah', '2022/2023', 11, 9, 1, '2022-10-13 00:19:46', '2022-10-13 00:19:46');
