(172, 'PG000989', 'ABRAHAM BANYU NARENDRA', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat Menjawab pertanyaan tentang identitas diri (nama panggilan). Mengenal dan mengidentifikasi bunyi huruf vokal. Mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat mampu berteman dan bekerjasama dengan orang lain Mampu beradaptasi dengan lingkungan baru mengerjakan tugas perkembangannya dengan semangat, pantang menyerah  Mentaati aturan yang berlaku Merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya Mencoret kertas tanpa bantuan/petunjuk. Mengekspresikan emosi yang sesuai dengan kondisi yang ada. Mampu mengelola emosi sesuai perkembangan Bersabar menunggu giliran. menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan)||Alhamdulillah Ananda sudah dapat Memakai dan melepas sepatu sendiri.  Mau mendengarkan ketika orangtua berbicara. Meneladani Rasulullah  Melakukan perbuatan baik setiap hari Mendoakan orangtua. Memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll). Memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll). Berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela. Berinfaq, bersedekah  Membantu pekerjaan orangtua. Duduk di hadapan orangtua dengan santun. Hafal dan mengimplementasikan  do\'a-do\'a harian. Mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri. Mencuci dan mengeringkan tangan sendiri dengan baik.  Memberikan perhatian dan pelayanan yang baik. Memperbanyak senyum Mengenal alam semesta dan isinya sebagai ciptaan Allah. Menirukan lafal kalimat thoyibah Makan sendiri Menggosok gigi.', 'Tengah', '2022/2023', 11, 9, 1, '2022-10-13 00:20:26', '2022-10-13 00:20:26'),
(173, 'PG000987', 'AKMAL KHALID KATITO', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), menyanyikan lagu fonik huruf vokal, mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, mengekspresikan emosi yang sesuai dengan kondisi yang ada, mampu mengelola emosi sesuai perkembangan, bersabar menunggu giliran, serta menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, meneladani Rasulullah, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, membantu pekerjaan orangtua, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memberikan perhatian dan pelayanan yang baik, memohon maaf bila bersalah, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, menirukan lafal kalimat thoyibah, makan sendiri, menggosok gigi, serta memakai celana panjang, kemeja, baju, atau kaos kaki tanpa dibantu (tidak termasuk kancing, gesper, dan ikat pinggang).', 'Tengah', '2022/2023', 12, 9, 1, '2022-10-13 00:25:47', '2022-10-13 00:25:47'),
(174, 'PG000986', 'FAYYADH KHAEDAR PURWANTO', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), menyanyikan lagu fonik huruf vokal, mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, berjalan mengikuti garis lurus, mengekspresikan emosi yang sesuai dengan kondisi yang ada, mampu mengelola emosi sesuai perkembangan, bersabar menunggu giliran, serta menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, meneladani Rasulullah, melakukan perbuatan baik setiap hari, meminta izin jika mau melakukan sesuatu, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, membantu pekerjaan orangtua, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memberikan perhatian dan pelayanan yang baik, memohon maaf bila bersalah, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, menirukan lafal kalimat thoyibah, makan sendiri, menggosok gigi, serta memakai celana panjang, kemeja, baju, atau kaos kaki tanpa dibantu (tidak termasuk kancing, gesper, dan ikat pinggang).', 'Tengah', '2022/2023', 13, 9, 1, '2022-10-13 00:39:32', '2022-10-13 00:39:32'),
(175, 'PG000994', 'HARITSAH GHANI PUTRANTO', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat mengenal dan mengidentifikasi bunyi huruf vokal serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat mengerjakan tugas perkembangannya dengan semangat, pantang menyerah  Mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mengekspresikan emosi yang sesuai dengan kondisi yang ada, serta bersabar menunggu giliran.||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berinfaq, bersedekah, duduk di hadapan orangtua dengan santun, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik,  memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, makan sendiri, serta menggosok gigi.', 'Tengah', '2022/2023', 14, 9, 1, '2022-10-13 00:43:10', '2022-10-13 00:43:10'),
(176, 'PG000980', 'JELITA ZAHIRA CELESTYN', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), menyanyikan lagu fonik huruf vokal, mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, berjalan mengikuti garis lurus, mengekspresikan emosi yang sesuai dengan kondisi yang ada, mampu mengelola emosi sesuai perkembangan, bersabar menunggu giliran, menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat memakai celana panjang, kemeja, baju, atau kaos kaki tanpa dibantu (tidak termasuk kancing, gesper, dan ikat pinggang), memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, meneladani Rasulullah, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, membantu pekerjaan orangtua, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memberikan perhatian dan pelayanan yang baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, menirukan lafal kalimat thoyibah, makan sendiri, serta menggosok gigi.', 'Tengah', '2022/2023', 15, 9, 1, '2022-10-13 02:30:43', '2022-10-13 02:30:43'),
(177, 'PG000977', 'KAYLILA SHAFIYAZEEMA BHASKARA', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), menyanyikan lagu fonik huruf vokal, mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah mampu berteman dan bekerjasama dengan orang lain, mampu beradaptasi dengan lingkungan baru, mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, berjalan mengikuti garis lurus, mengekspresikan emosi yang sesuai dengan kondisi yang ada, mampu mengelola emosi sesuai perkembangan, bersabar menunggu giliran, serta menjaga dan merawat barang milik pribadi dan yang dipinjam atau yang diamanahkan  (masih diingatkan).||Alhamdulillah Ananda sudah dapat memakai celana panjang, kemeja, baju, atau kaos kaki tanpa dibantu (tidak termasuk kancing, gesper, dan ikat pinggang), memakai dan melepas sepatu sendiri, mau mendengarkan ketika orangtua berbicara, menunjukkan adab kepada saudara, meneladani Rasululla, melakukan perbuatan baik setiap hari, meminta izin jika mau melakukan sesuatu, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, membantu pekerjaan orangtua, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memberikan perhatian dan pelay