(180, 'PG000992', 'LUQMAN ABDURRAHMAN MUTTAQIN RAMADHANA', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat menjawab pertanyaan tentang identitas diri (nama panggilan), mengenal dan mengidentifikasi bunyi huruf vokal, serta mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah dapat mampu berteman dan bekerjasama dengan orang lain mengerjakan tugas perkembangannya dengan semangat, pantang menyerah, mentaati aturan yang berlaku, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mencoret kertas tanpa bantuan/petunjuk, mengekspresikan emosi yang sesuai dengan kondisi yang ada, dan bersabar menunggu giliran.||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, meneladani Rasulullah, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), berkata dengan lembut, sopan, tawadhu\' dan tidak mengeraskan suara serta tidak mencela, berinfaq, bersedekah, duduk di hadapan orangtua dengan santun, hafal dan mengimplementasikan  do\'a-do\'a harian, mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, menirukan lafal kalimat thoyibah, makan sendiri, serta menggosok gigi.', 'Tengah', '2022/2023', 19, 9, 1, '2022-10-13 02:54:28', '2022-10-13 02:54:28'),
(181, 'PG000996', 'NAUFAL MUHAMMAD ZAIDAN ALBARR', 'PG 2', 'PG', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat mengenal dan mengidentifikasi bunyi huruf vokal, dan mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur).||Alhamdulillah Ananda sudah mampu beradaptasi dengan lingkungan baru, merapikan dan mengembalikan  barang (mainan, dll) setelah digunakan sesuai tempatnya, mengekspresikan emosi yang sesuai dengan kondisi yang ada, serta  bersabar menunggu giliran.||Alhamdulillah Ananda sudah dapat memakai dan melepas sepatu sendiri, melakukan perbuatan baik setiap hari, mendoakan orangtua, memanggil orangtua dengan sebutan yang baik (misal Ibu, bapak, Mama, papa dll), mengucapkan dan menjawab salam, mencium tangan serta menyambut kedatangan orang tua dengan wajah berseri, mencuci dan mengeringkan tangan sendiri dengan baik, memperbanyak senyum, mengenal alam semesta dan isinya sebagai ciptaan Allah, makan sendiri, dan menggosok gigi.', 'Tengah', '2022/2023', 20, 9, 1, '2022-10-13 02:57:46', '2022-10-13 02:57:46'),
(182, 'TK001650', 'QASIRATUT TARFIIN', 'B3', 'TK B', 'Dasar-dasar Literasi, Matematika, Sains, Teknologi, Rekayasa, dan Seni||Jati Diri||Nilai Agama dan Budi Pekerti', 'Alhamdulillah Ananda sudah dapat Memahami kalimat ajakan  Membuat karya seni sesuai kreativitasnya. Menyebutkan lambang bilangan 1-20. Mampu menggunakan lima indera yang dimiliki untuk mendapatkan informasi (seperti, bentuk, warna, aroma, rasa, bunyi, dan tekstur). Menulis dan membaca kalimat.||Alhamdulillah Ananda sudah dapat Melompat satu kaki tanpa berpegangan sejauh minimal 1 m. Menulis nama sendiri. Mampu datang ke sekolah tepat waktu Melompat satu kaki tanpa berpegangan sejauh minimal 1 m. mampu berteman dan bekerjasama dengan orang lain Mampu beradaptasi dengan lingkungan baru melaksanakan tugas dan kewajiban yang telah diamanahkan dengan baik dan tuntas (dengan pendampingan)  Berdiri satu kaki minimal 11 detik. Melakukan permainan fisik dengan aturan. Menggunakan tangan kanan dan kiri dalam berbagai aktivitas (misal: mengancingkan baju, menali sepatu, menggambar, menempel, menggunting, makan, dll).||Alhamdulillah Ananda sudah dapat Menirukan sholawat  Membuang sampah pada tempatnya Menirukan lafal syahadat dan artinya  Mengucapkan kalimat thoyibah sesuai aktivitas yang dilakukan dan aktivitas yang terjadi di lingkungannya.  Berwudlu sesuai Rasulullah (pendampingan) Mengenal dan mampu mengikuti gerakan Sholat Mengenal dan mampu mengikuti gerakan Sholat Hafal dan mengimplementasikan  do\'a-do\'a harian. Membantu pekerjaan orangtua. Menghafal  syahadat berserta artinya  Mengenal ibadah haji Memakai baju sendiri tanpa bantuan. Meyakini bahwa Allah adalah  pencipta dan pengatur alam semesta. Mendoakan orangtua. Berdoa hanya meminta kepada Allah. Memiliki perasaan merasa diawasi oleh Allah. Menghafal lafal kalimat thoyibah', 'Tengah', '2022/2023', 170, 6, 1, '2022-10-13 04:18:46', '2022-10-13 04:18:46');
